import {
    appbarHeight
} from '../../masterStyle.js';

const goldenRatio = 1.61803398875;

const dashboardStyle = theme => ({
    container: {
        height: "100%",
        [theme.breakpoints.up('sm')]: {
            marginTop: theme.spacing(),
            marginLeft: theme.spacing(4),
            marginRight: theme.spacing(4),
            width: "inherit"
        }
    },
    title: {
        padding: "1.5rem"
    },
});

export default dashboardStyle;
